import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

import Home from "./pages/Home";
import Reservas from "./pages/Reservas";
import Header from "./components/Header";

function App() {
  return (
    <>
      <BrowserRouter>
        <Header/>
        <Routes>
          <Route exact path="/" element={<Home/>}/>
          <Route exact path="/reservas" element={<Reservas/>}/>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
